import React, {useState} from 'react';
import {Button} from "react-bootstrap";
import {useNavigate} from "react-router-dom";
import AuthService from "../../services/AuthService";
import {Link} from "react-router-dom";


const LoginForm = () => {

    const navigate = useNavigate();

    const handleSubmit = async (event) => {
        event.preventDefault();
        AuthService.login(loginRequest).then(() => {
            navigate("/");
        });
    };

    const [loginRequest, loginRequestData] = useState({
        username: "",
        password: ""
    });

    const handleChange = (event) => {
        const {name, value} = event.target;
        loginRequestData((prevFormData) => ({
            ...prevFormData,
            [name]: value,
        }));
    };


    return (
        <>
            <div className={"container"}>
                <div className={"row"}>
                    <form onSubmit={handleSubmit}>
                        <div className={"col-xl-12"}>
                            <div className={"row"}>
                                <div className={"offset-xl-3 col-xl-6 mt-3"}>
                                    <input placeholder="Username" className={"form-control"} type="text" id="username"
                                           name="username" value={loginRequest.username} onChange={handleChange}/>
                                </div>
                                <div className={"offset-xl-3 col-xl-6 mt-2"}>
                                    <input placeholder="Password" className={"form-control"} type="password" id="password"
                                           name="password" value={loginRequest.password} onChange={handleChange}/>
                                </div>
                                <div className={"offset-xl-3 col-xl-1 mt-xl-2"}>
                                    <Link style={{color: "black"}} to="/registration">Registration</Link>
                                </div>
                                <div className={"offset-xl-4 col-xl-1 mt-2"}>
                                    <Button style={{color: "white"}} variant={"primary"} type="submit">Submit</Button>
                                </div>
                            </div>
                        </div>
                    </form>
                </div>
            </div>
        </>
    );
};

export default LoginForm;
